		function getSpeedColor(speed) {
		  var color;
		  if (speed <= 10) {
			color = "#FF0000";
		  } else if (speed <= 20) {
			color = "#FF3300";
		  } else if (speed <= 30) {
			color = "#FF6600";
		  } else if (speed <= 40) {
			color = "#FF9900";
		  } else if (speed <= 50) {
			color = "#FFFF00";
		  } else if (speed <= 60) {
			color = "#99FF00";
		  } else {
			color = "#00FF00";
		  }
		  return color;
		}

function updateLineColor() {
  var currentTime = new Date();
  document.getElementById("currentTime").innerHTML = currentTime.toLocaleString('en-US', {hour: '2-digit', minute: '2-digit', hour12: true});

    var minute = feature.properties.time.split(':')[1].split(' ')[0];
    var ampm = feature.properties.time.split(':')[1].split(' ')[1];
    return hour + ':' + minute + ' ' + ampm === currentTime;
  });
  var filteredDataGeoJson = {
    type: "FeatureCollection",
    features: filteredData
  };
  
  map.getSource("filteredData").setData(filteredDataGeoJson);

    var color = filteredData[i].properties.color;
    map.setPaintProperty(i+1, "line-color", color);
